INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'0CB40850FE23A14D996C95578B9711DA', X'89CF5E98A4582640848BF6C65A2148CB', X'89CF5E98A4582640848BF6C65A2148CB', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat the oven to 325 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D35485CBAF862447947C50A929219ADD', X'89CF5E98A4582640848BF6C65A2148CB', X'89CF5E98A4582640848BF6C65A2148CB', 1, NULL, NULL, 2, NULL, 0, 'Remove all the flesh from the avocados, place into a bowl, and mash. Don''t do it too vigorouslyit''s fine to have a few small lumps in there, which adds to the appearance and texture.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'FD09455DA268424EB0C8BEA2C6FB1AE5', X'89CF5E98A4582640848BF6C65A2148CB', X'89CF5E98A4582640848BF6C65A2148CB', 2, NULL, NULL, 2, NULL, 0, 'Add the almond or rice flour to the avocado mash and stir well. The flour helps to make a crispier chip by absorbing excess moisture from the mixture.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'63C5F4DCA7557E45A1A26F0DE4B25425', X'89CF5E98A4582640848BF6C65A2148CB', X'89CF5E98A4582640848BF6C65A2148CB', 3, NULL, NULL, 2, NULL, 0, 'Grate the zest and squeeze out the juice of the lime. Add these to the avocado mixture with the chili, salt, and pepper. Add the Parmesan, stir well, and place the mixture in the refrigerator for 10 minutes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'C8C2D279137C38438CA4E1360B47E99C', X'89CF5E98A4582640848BF6C65A2148CB', X'89CF5E98A4582640848BF6C65A2148CB', 4, NULL, NULL, 2, NULL, 0, 'Line a heavy baking sheet with baking paper and spray with nonstick cooking spray or use a non-stick baking mat. Scoop out generous teaspoons of the chilled avocado and place on the baking tray, leaving plenty of space around each. Dip your finger in a little cold water and gently pat the mounds down to form neat even rounds. They will spread further in the oven, so make sure they are not touching.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'2D0BC1243A1A2F44A63344C3F6A94D9C', X'89CF5E98A4582640848BF6C65A2148CB', X'89CF5E98A4582640848BF6C65A2148CB', 5, NULL, NULL, 2, NULL, 0, 'Bake in the center of the preheated oven for 20 minutes. You will need to keep an eye on them, so they don''t burn; if they are cooking too quickly, lower the heat slightly.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'B3DCB2CF3A01DC45AA8FF5F69789741C', X'89CF5E98A4582640848BF6C65A2148CB', X'89CF5E98A4582640848BF6C65A2148CB', 6, NULL, NULL, 2, NULL, 0, 'Once cooked, remove the tray from the oven and leave the crisps to cool for 5 minutes, then remove from the tray with a palette knife and place on a cooling rack. Repeat until all of the mixture is used up.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'87AD2C055ED2EC499879F2FC5F8D2A39', X'89CF5E98A4582640848BF6C65A2148CB', X'89CF5E98A4582640848BF6C65A2148CB', 7, NULL, NULL, 2, NULL, 0, 'Serve the chips with your favorite party dip or eat as a tasty snack as they are.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'5D311AD8934E674F86284D6C9C622BC0', X'04EF7508F732664F8BA6296BE4B3181A', X'04EF7508F732664F8BA6296BE4B3181A', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat the oven to 325 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'E14A134CA916EE4B98A1BFAB82AC156D', X'04EF7508F732664F8BA6296BE4B3181A', X'04EF7508F732664F8BA6296BE4B3181A', 1, NULL, NULL, 2, NULL, 0, 'Add the almond flour, coconut flour, salt, baking soda, eggs, and heavy cream to a mixing bowl. Whisk together until combined. Add in the melted butter and continue to mix together until all the ingredients are incorporated.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'1B9597482EE1E944812F837E7EF1E541', X'04EF7508F732664F8BA6296BE4B3181A', X'04EF7508F732664F8BA6296BE4B3181A', 2, NULL, NULL, 2, NULL, 0, 'Generously grease a 9 or 10-inch cast iron skillet with butter.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'9D21481B3E841E4F8482A03062C8303C', X'04EF7508F732664F8BA6296BE4B3181A', X'04EF7508F732664F8BA6296BE4B3181A', 3, NULL, NULL, 2, NULL, 0, 'Pour the batter into the greased skillet. Place it in the preheated oven and bake for 25 to 30 minutes or until golden brown and firm.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'556E9F02C0000E428473704144E7E0B1', X'04EF7508F732664F8BA6296BE4B3181A', X'04EF7508F732664F8BA6296BE4B3181A', 4, NULL, NULL, 2, NULL, 0, 'Allow the cornbread to cool for about five minutes and then slice. Serve with butter.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'C83DF1279C86904AB7CD9332FC7067D1', X'0B7BA2C62E611741BE38D392036ED6D3', X'0B7BA2C62E611741BE38D392036ED6D3', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6C38CA109C79554A9C9DBA0B1F798BD3', X'0B7BA2C62E611741BE38D392036ED6D3', X'0B7BA2C62E611741BE38D392036ED6D3', 1, NULL, NULL, 2, NULL, 0, 'Preheat the oven to 300 F. Line a baking sheet with a silicone mat or line with parchment paper and spray with nonstick spray.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'677CD14BB66B5444A31269832CF8D643', X'0B7BA2C62E611741BE38D392036ED6D3', X'0B7BA2C62E611741BE38D392036ED6D3', 2, NULL, NULL, 2, NULL, 0, 'Separate the eggs, placing the whites in one mixing bowl and the yolks in another mixing bowl.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'CF6C9C51BE0B81428B2048248451F8C5', X'0B7BA2C62E611741BE38D392036ED6D3', X'0B7BA2C62E611741BE38D392036ED6D3', 3, NULL, NULL, 2, NULL, 0, 'Add the cream of tartar to the egg whites. Beat the whites with a hand mixer until stiff peaks form, or about 2 to 3 minutes. When you dip a beater from the mixer into the eggs and pull it out, a peak should form and stay standing up. Don''t over-beat the eggs or they will become crumbly.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'1042B35B99CF61428F27D3E381391104', X'0B7BA2C62E611741BE38D392036ED6D3', X'0B7BA2C62E611741BE38D392036ED6D3', 4, NULL, NULL, 2, NULL, 0, 'Add the cream cheese and salt to the bowl with the egg yolks. Beat until smooth.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'4E83D88234C53643B1BDC02C6DF01FC1', X'0B7BA2C62E611741BE38D392036ED6D3', X'0B7BA2C62E611741BE38D392036ED6D3', 5, NULL, NULL, 2, NULL, 0, 'Carefully add about 1/3 of the egg whites to the yolks mixture. Carefully fold the two mixtures together, careful not to deflate the egg whites. Repeat two more times with the remaining egg whites, folding in just until mixed.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'4A01B8E017DF7F4985EDDF7E574DFC81', X'0B7BA2C62E611741BE38D392036ED6D3', X'0B7BA2C62E611741BE38D392036ED6D3', 6, NULL, NULL, 2, NULL, 0, 'Scoop out into 6 to 8 separate disks (depending on what size you want) onto the prepared baking sheet, leaving them at least 2 to 3 inches apart.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'155EC2D17D6C7247947C47DD578A6D36', X'0B7BA2C62E611741BE38D392036ED6D3', X'0B7BA2C62E611741BE38D392036ED6D3', 7, NULL, NULL, 2, NULL, 0, 'Bake 25 to 35 minutes depending on the size of your clouds, or until golden brown. Start checking the breads at the 25 minute mark since they can overcook easily.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D727DC5B57E92943A57286A91C230A2D', X'0B7BA2C62E611741BE38D392036ED6D3', X'0B7BA2C62E611741BE38D392036ED6D3', 8, NULL, NULL, 2, NULL, 0, 'Let cool for a few minutes on the baking sheet before placing on a cooling rack. Store leftover cloud breads in an airtight container for up to 3 days or freeze.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'B18E89E7EF1C9E4FA20ABB1160FE5FF3', X'0DD6A09C491D88428CA9D92CF9353613', X'0DD6A09C491D88428CA9D92CF9353613', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'DF6B907189B8A94BB27A2AFFFA39FE0A', X'0DD6A09C491D88428CA9D92CF9353613', X'0DD6A09C491D88428CA9D92CF9353613', 1, NULL, NULL, 2, NULL, 0, 'Whip the cream in a mixing bowl until medium peaks form, about 3 minutes with an electric frother or mixer.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'1C32CE062E7C5C4EB4FFE7D45EFA8FEC', X'0DD6A09C491D88428CA9D92CF9353613', X'0DD6A09C491D88428CA9D92CF9353613', 2, NULL, NULL, 2, NULL, 0, 'Add the cocoa powder, stevia, and salt.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'E705D1E0DC000345B01A03AFC114B096', X'0DD6A09C491D88428CA9D92CF9353613', X'0DD6A09C491D88428CA9D92CF9353613', 3, NULL, NULL, 2, NULL, 0, 'Continue beating until stiff peaks form, about 30 seconds longer.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'82D077D352AE64438F2DB9E181DD6170', X'44DE202A9AB2FC4E935B00E193939B3E', X'44DE202A9AB2FC4E935B00E193939B3E', 0, NULL, NULL, 2, NULL, 0, 'Gather your ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'929846F11B4F3E4FAB04691321DA8203', X'44DE202A9AB2FC4E935B00E193939B3E', X'44DE202A9AB2FC4E935B00E193939B3E', 1, NULL, NULL, 2, NULL, 0, 'Add the softened cream cheese, almond flour, eggs and vanilla extract to a large bowl.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'C772FB288E539F4D9C9501F490C6DC59', X'44DE202A9AB2FC4E935B00E193939B3E', X'44DE202A9AB2FC4E935B00E193939B3E', 2, NULL, NULL, 2, NULL, 0, 'Whisk them together until completely combined and smooth. A few lumps are okay. The batter will be thin.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'8934C221687DAB418E2BFC373468E38D', X'44DE202A9AB2FC4E935B00E193939B3E', X'44DE202A9AB2FC4E935B00E193939B3E', 3, NULL, NULL, 2, NULL, 0, 'Heat a large cast-iron griddle or nonstick pan on medium-high heat. Add butter and swirl it around until it''s melted. Then turn the heat down to medium-low. Add the pancake batter in the size you wish. The smaller, the better because the pancakes are delicate, harder to flip when large.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'33630EDCAFADB84F9704405C8E2F831A', X'44DE202A9AB2FC4E935B00E193939B3E', X'44DE202A9AB2FC4E935B00E193939B3E', 4, NULL, NULL, 2, NULL, 0, 'Cook the pancakes for about a minute and then flip the pancakes over. Turn the heat down if you need to so that they do not burn. Cook time may vary depending on your stove top.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'305381FF0488D746AF214A88C3C0C794', X'44DE202A9AB2FC4E935B00E193939B3E', X'44DE202A9AB2FC4E935B00E193939B3E', 5, NULL, NULL, 2, NULL, 0, 'Serve the pancakes with extra butter and dig in!');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'490AAC189C2A5D4290FC13332C8262FB', X'1A73149E16297947965F0837C020B95B', X'1A73149E16297947965F0837C020B95B', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat the oven to 400 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'53D57CA67E2CF34F8B2C36E232CABC04', X'1A73149E16297947965F0837C020B95B', X'1A73149E16297947965F0837C020B95B', 1, NULL, NULL, 2, NULL, 0, 'Place the cauliflower florets into your food processor and pulse until the cauliflower is the size of rice. You can do this in batches to cut down on dealing with large pieces.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'70CD89078FFD024FA7C86E9E5F687222', X'1A73149E16297947965F0837C020B95B', X'1A73149E16297947965F0837C020B95B', 2, NULL, NULL, 2, NULL, 0, 'Add the shredded cheese, egg, egg white, tapioca, garlic powder, salt, and pepper to the bowl of the food processor and pulse until combined.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'8B7F3733A2FCEA4FA4EB4D1E8D90B585', X'1A73149E16297947965F0837C020B95B', X'1A73149E16297947965F0837C020B95B', 3, NULL, NULL, 2, NULL, 0, 'Scoop 1/4 cup of the cauliflower mixture onto a parchment-lined baking sheet.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'85D687A9831FBE41AC4476462EAEE230', X'1A73149E16297947965F0837C020B95B', X'1A73149E16297947965F0837C020B95B', 4, NULL, NULL, 2, NULL, 0, 'Place another piece of parchment paper on top of the cauliflower scoops and press down with another baking sheet of the same size until you have created a thin circle (about a 1/4 inch thick).');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'A771411105934541AA43D1191E88DB71', X'1A73149E16297947965F0837C020B95B', X'1A73149E16297947965F0837C020B95B', 5, NULL, NULL, 2, NULL, 0, 'Slowly remove the parchment paper. If it sticks to the parchment, just reshape it a little with your hands.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'CA4FB1D26E2E56458A449E9DF937578E', X'1A73149E16297947965F0837C020B95B', X'1A73149E16297947965F0837C020B95B', 6, NULL, NULL, 2, NULL, 0, 'Place the baking sheet in the preheated oven and bake for about 20 minutes or until lightly browned and firm.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'34B0367EB5DD3149A176A64B4FD85957', X'1A73149E16297947965F0837C020B95B', X'1A73149E16297947965F0837C020B95B', 7, NULL, NULL, 2, NULL, 0, 'Remove the tortillas from the oven, allow them to cool slightly and serve them with your favorite taco fillings.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6C97D4B21A01B04CBE967AAFF0D7E1B7', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'734B3BB93899134ABBFB85509DE3E9E7', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', 1, NULL, NULL, 2, NULL, 0, 'Add the olive oil to a sauté pan and heat on medium-high heat. Add the minced onion and sauté until translucent and soft.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'232B0E1879AEA54D8516E4C8AA12F49F', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', 2, NULL, NULL, 2, NULL, 0, 'Add the broth to the pan and heat for about five minutes. Add the contents to a blender and puree until completely smooth.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'DF9A6952ED4F384E8DE7BADFD25257CE', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', 3, NULL, NULL, 2, NULL, 0, 'Temper the egg yolks with the hot broth by adding a little bit of the hot broth to the egg yolks while whisking vigorously. Keep adding the broth until it is incorporated into the eggs.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'68CE94D3D3227847B44F8D6CAA0FE26D', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', 4, NULL, NULL, 2, NULL, 0, 'Soften the gelatin with the cold water. Stir until the gelatin dissolves.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'E18D32C8E3969747B692878B080FC55D', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', 5, NULL, NULL, 2, NULL, 0, 'Add the gravy back to the blender along with the gelatin and pepper. Blend until completely smooth. Then blend for another 2 minutes or until the gravy is slightly thickened. Blend in the butter if you wish.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'1D00EA83F215A14F909F69D73754C0C1', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', X'02C94CBD6CF90A43ABFAAA25F1DF4A79', 6, NULL, NULL, 2, NULL, 0, 'Serve the gravy over your favorite turkey or mashed cauliflower.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'A3ED7E32B474274493CD7BE11346DA5B', X'3EDE1C29B382694AAC7327A3F9CF4D2F', X'3EDE1C29B382694AAC7327A3F9CF4D2F', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat the oven to 375 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'4C64D9CC55EEC34492956896982568CA', X'3EDE1C29B382694AAC7327A3F9CF4D2F', X'3EDE1C29B382694AAC7327A3F9CF4D2F', 1, NULL, NULL, 2, NULL, 0, 'In a small mixing bowl, whisk cream cheese with the 2 tablespoons of sweetener and set aside.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'346BB393E49DDA448DD29073ADF00FF9', X'3EDE1C29B382694AAC7327A3F9CF4D2F', X'3EDE1C29B382694AAC7327A3F9CF4D2F', 2, NULL, NULL, 2, NULL, 0, 'Combine the almond flour, 3/4 cup of the sweetener, baking powder, pumpkin pie spice, and salt in a large mixing bowl.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'CC88C6A2FFDA2D469DB1245CE7CB65AA', X'3EDE1C29B382694AAC7327A3F9CF4D2F', X'3EDE1C29B382694AAC7327A3F9CF4D2F', 3, NULL, NULL, 2, NULL, 0, 'Add pumpkin puree, yogurt, eggs, and oil, and whisk until a thick batter is formed.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6101B6DEC797AC43BCFD57F1FA272B5F', X'3EDE1C29B382694AAC7327A3F9CF4D2F', X'3EDE1C29B382694AAC7327A3F9CF4D2F', 4, NULL, NULL, 2, NULL, 0, 'Divide batter between 12 greased and/or lined muffin tin cups, then place a dollop of cream cheese in each. Stir cream cheese mix with a toothpick to create a swirl in each muffin.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'7A3197D4E53945439BE17F3DFF7820E2', X'3EDE1C29B382694AAC7327A3F9CF4D2F', X'3EDE1C29B382694AAC7327A3F9CF4D2F', 5, NULL, NULL, 2, NULL, 0, 'Bake for 22 minutes, until set and golden.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'3C6F311AA252B442912E2A59DC0B24A8', X'3EDE1C29B382694AAC7327A3F9CF4D2F', X'3EDE1C29B382694AAC7327A3F9CF4D2F', 6, NULL, NULL, 2, NULL, 0, 'Let cool for 10 minutes before removing from the pan and serving.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'BF6E9EA831BF0C4D8E27D033ACCF4807', X'5A9F3E209E152640A7B6ABD29B60F5B2', X'5A9F3E209E152640A7B6ABD29B60F5B2', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat your oven to 350 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'E8A741EF94A3B144BD82D492A37C643F', X'5A9F3E209E152640A7B6ABD29B60F5B2', X'5A9F3E209E152640A7B6ABD29B60F5B2', 1, NULL, NULL, 2, NULL, 0, 'In a mixing bowl, stir together all dry ingredients (almond flour to pumpkin pie spice) with a fork.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'0612408F111A6C4587CACB5BF4A63FC2', X'5A9F3E209E152640A7B6ABD29B60F5B2', X'5A9F3E209E152640A7B6ABD29B60F5B2', 2, NULL, NULL, 2, NULL, 0, 'Add all remaining ingredients and stir with a fork until free of lumps.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'288219732F0D5A47A39FA5206370306C', X'5A9F3E209E152640A7B6ABD29B60F5B2', X'5A9F3E209E152640A7B6ABD29B60F5B2', 3, NULL, NULL, 2, NULL, 0, 'Pour batter into a greased 8 x 4-inch loaf pan and place in the oven.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'035AE9528E767449AD8234F836A889F6', X'5A9F3E209E152640A7B6ABD29B60F5B2', X'5A9F3E209E152640A7B6ABD29B60F5B2', 4, NULL, NULL, 2, NULL, 0, 'Let cool before removing from the pan, then slice and enjoy.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'DABA669F127D7D4EB159B45E0E3C832A', X'01283AAEFE5AFF459AAF56B545EC1819', X'01283AAEFE5AFF459AAF56B545EC1819', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D7CC77AA1256C549BE0903C65430CCE9', X'01283AAEFE5AFF459AAF56B545EC1819', X'01283AAEFE5AFF459AAF56B545EC1819', 1, NULL, NULL, 2, NULL, 0, 'Preheat the oven to 250 F. Add the cubed cornbread to a parchment-lined baking sheet. Make sure the pieces are spread around and arent too cramped. Place the pan in the oven and bake for about an hour or until they are golden brown, crunchy, and dried out.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'9418419B6772B347B3E35AAB623ABD0F', X'01283AAEFE5AFF459AAF56B545EC1819', X'01283AAEFE5AFF459AAF56B545EC1819', 2, NULL, NULL, 2, NULL, 0, 'Add the butter to a sauté pan over medium heat and allow it to melt. Then add the onion and celery. Sauté until the vegetables are soft and translucent.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'F3D987536DC0194B83B707F8C68C5023', X'01283AAEFE5AFF459AAF56B545EC1819', X'01283AAEFE5AFF459AAF56B545EC1819', 3, NULL, NULL, 2, NULL, 0, 'Whisk together the broth, eggs, poultry seasoning, salt, pepper, and thyme in a measuring cup or a bowl.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'7FCD2DA3F6EDAB49968B93851B26E2AD', X'01283AAEFE5AFF459AAF56B545EC1819', X'01283AAEFE5AFF459AAF56B545EC1819', 4, NULL, NULL, 2, NULL, 0, 'Toss together the toasted bread cubes, sautéed vegetables, and the chopped parsley and sage in a casserole dish.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'05DC8D30EDB41748BECF6DC91DCB01B2', X'01283AAEFE5AFF459AAF56B545EC1819', X'01283AAEFE5AFF459AAF56B545EC1819', 5, NULL, NULL, 2, NULL, 0, 'Pour the liquid mixture over the top of the casserole. It should cover most of the bread cubes. Cover the pan and bake for about 40 minutes or until all of the liquid has been absorbed. Remove the foil and put the casserole back in the oven for about 10 minutes, until the top is crispy and browned.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'675ACD74B43AA94298037748A001A311', X'01283AAEFE5AFF459AAF56B545EC1819', X'01283AAEFE5AFF459AAF56B545EC1819', 6, NULL, NULL, 2, NULL, 0, 'Serve with more chopped fresh parsley. Enjoy!');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6B69A6ADC6F8FD42995E25E181883D16', X'3018B0D788EA384E83131684D58CCCB4', X'3018B0D788EA384E83131684D58CCCB4', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat the oven to 350 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'CEFBB46798FA8D499BCC8B1C41B44C71', X'3018B0D788EA384E83131684D58CCCB4', X'3018B0D788EA384E83131684D58CCCB4', 1, NULL, NULL, 2, NULL, 0, 'Mix all ingredients together in a large mixing bowl and whisk until all lumps have disappeared.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'5B7C717B6BA0BE4185C06925DD1C08D5', X'3018B0D788EA384E83131684D58CCCB4', X'3018B0D788EA384E83131684D58CCCB4', 2, NULL, NULL, 2, NULL, 0, 'Pour mixture into a greased and/or parchment lined 9 x 5-inch loaf pan.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'71F4712DB75AF548AA5EB5975CE1506F', X'3018B0D788EA384E83131684D58CCCB4', X'3018B0D788EA384E83131684D58CCCB4', 3, NULL, NULL, 2, NULL, 0, 'Bake in preheated oven until set, about 55 minutes. Let cool completely before removing from the pan.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6C09A3BDABC4E94B99C91C2E6B27D43F', X'13AFD8E2AD7D3B4EB9D4A6BDD176DCBD', X'13AFD8E2AD7D3B4EB9D4A6BDD176DCBD', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients and make sure you have enough flat, empty space in your freezer to fit your popsicle mold tray.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'4C5B6A23C1AB354992BB74BF32206EF1', X'13AFD8E2AD7D3B4EB9D4A6BDD176DCBD', X'13AFD8E2AD7D3B4EB9D4A6BDD176DCBD', 1, NULL, NULL, 2, NULL, 0, 'Reserve 3/4 cup of the strawberries. Add the cream cheese, heavy cream, allulose, and the remaining 1 cup of the strawberries to a blender. Blend the mixture until smooth, then add the reserved strawberries. Pour mixture directly from blender pitcher into a 10-popsicle tray, filling each. Place the lid on the tray and insert popsicle sticks into the openings, leaving about 2 inches of stick out. Freeze until firm, about 4 hours.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'B8B0AA0F32136048AF26C185607C2837', X'13AFD8E2AD7D3B4EB9D4A6BDD176DCBD', X'13AFD8E2AD7D3B4EB9D4A6BDD176DCBD', 2, NULL, NULL, 2, NULL, 0, 'To unmold, take tray out of the freezer and remove the lid. If popsicles are stuck to the tray, as they likely will be, run the plastic outside of the tray under warm water for 10 seconds, then take popsicles out of the molds. Serve right away and enjoy!');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'0E3AEC0B8D6D6B47B39E8FC540021190', X'5B5D1D9AD6286F48BDCD0A50E155E41B', X'5B5D1D9AD6286F48BDCD0A50E155E41B', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat the oven to 425 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'29655A223464ED40A49B71C0646E7C0E', X'5B5D1D9AD6286F48BDCD0A50E155E41B', X'5B5D1D9AD6286F48BDCD0A50E155E41B', 1, NULL, NULL, 2, NULL, 0, 'Peel the outer skin of the jicama. Cut into fry-like pieces. They should be thick enough to turn easily with tongs, but thin enough that they will crisp up in the oven.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'4D11E9F6AD53EE4DBA1C41CBC70AD96F', X'5B5D1D9AD6286F48BDCD0A50E155E41B', X'5B5D1D9AD6286F48BDCD0A50E155E41B', 2, NULL, NULL, 2, NULL, 0, 'Place the jicama pieces in a single layer on a large baking sheet. Do not overcrowd or overlap or the pieces will not crisp well. Depending on the size of your jicama or the baking sheet, two baking sheets might be necessary to avoid overcrowding. Drizzle with olive oil and toss to coat.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'CF58D464E525E44C8D11D68AF973E187', X'5B5D1D9AD6286F48BDCD0A50E155E41B', X'5B5D1D9AD6286F48BDCD0A50E155E41B', 3, NULL, NULL, 2, NULL, 0, 'In a small bowl, combine the chili powder, garlic powder, onion powder, kosher salt, and ground cumin. Sprinkle the seasoning mix over the jicama and toss to coat. Roast in the oven for 15 minutes, then flip all of the fries to crisp the other side, about 10 to 15 minutes more. The jicama fries should be slightly browned and crispy.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'62318A8E327EB748AEF0BD821176CBAA', X'5B5D1D9AD6286F48BDCD0A50E155E41B', X'5B5D1D9AD6286F48BDCD0A50E155E41B', 4, NULL, NULL, 2, NULL, 0, 'Before serving, squeeze the fries with fresh lime juice and sprinkle with chopped fresh cilantro. Season with additional salt and pepper to taste.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'CB57E3E43361404A8B9FB2BC899A4071', X'5B5D1D9AD6286F48BDCD0A50E155E41B', X'5B5D1D9AD6286F48BDCD0A50E155E41B', 5, NULL, NULL, 2, NULL, 0, 'Enjoy!');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'842F2B1C7746A14382A262692C3CDCFF', X'7A25239951090F4AA694EAD769400B82', X'7A25239951090F4AA694EAD769400B82', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat the oven to 350 F. Prepare a baking sheet by covering with parchment paper.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'1A7E4E6BC4454B4295711A22738336C8', X'7A25239951090F4AA694EAD769400B82', X'7A25239951090F4AA694EAD769400B82', 1, NULL, NULL, 2, NULL, 0, 'In a medium bowl, combine blanched almond flour, keto sugar, melted coconut oil, lemon juice, lemon zest, and sea salt.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'7984C8C9FA92104DA3C7D664D5916C64', X'7A25239951090F4AA694EAD769400B82', X'7A25239951090F4AA694EAD769400B82', 2, NULL, NULL, 2, NULL, 0, 'Mix well, breaking up any lumps in the flour and sugar. The dough will be slightly crumbly but will press together in your hand.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6205CEE4D936AD469256621053979D3A', X'7A25239951090F4AA694EAD769400B82', X'7A25239951090F4AA694EAD769400B82', 3, NULL, NULL, 2, NULL, 0, 'Roll into 1-inch balls and place 2 inches apart on the prepared baking sheet.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'AC8A6FE5CAD55845B1D708D39267FB79', X'7A25239951090F4AA694EAD769400B82', X'7A25239951090F4AA694EAD769400B82', 4, NULL, NULL, 2, NULL, 0, 'Place one whole almond in the center of each ball and press down to flatten slightly.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'7A8E0FA1CD307E408FB13CCF770618D8', X'7A25239951090F4AA694EAD769400B82', X'7A25239951090F4AA694EAD769400B82', 5, NULL, NULL, 2, NULL, 0, 'Cool the cookies on the baking sheet for 10 minutes. Transfer to a wire rack and cool completely.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'680F67E3EFED1F4CBB97CEF41E0732CB', X'7A25239951090F4AA694EAD769400B82', X'7A25239951090F4AA694EAD769400B82', 6, NULL, NULL, 2, NULL, 0, 'Because of the high fat content in the almond flour and coconut oil, it is best to store these cookies in an airtight container in the refrigerator. They will keep in the refrigerator for up to 2 weeks or can be frozen for up to 6 months.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'EB3CB40FA2376F45A3C0B3F0331C718A', X'7C01E94A2376FD4AA7C20E50BEA79363', X'7C01E94A2376FD4AA7C20E50BEA79363', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'00D5D309E2C4784A80B4E856463ACC35', X'7C01E94A2376FD4AA7C20E50BEA79363', X'7C01E94A2376FD4AA7C20E50BEA79363', 1, NULL, NULL, 2, NULL, 0, 'Trim all of the fat off of the meat. Fat does not dehydrate well, will create an unpleasant texture if left on the meat, and can cause faster decay.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'71B7BD66B52F5D4E9C1AAEB5C4D7BD28', X'7C01E94A2376FD4AA7C20E50BEA79363', X'7C01E94A2376FD4AA7C20E50BEA79363', 2, NULL, NULL, 2, NULL, 0, 'With a very sharp knife, slice the beef with or against the grain depending on your preferred texture. Cut it thinly, at least 1/4-inch thick, if not thinner. Freezing the meet for one hour prior to slicing will make this process much easier.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'77A605564034C140A2EC5BD6423FB529', X'7C01E94A2376FD4AA7C20E50BEA79363', X'7C01E94A2376FD4AA7C20E50BEA79363', 3, NULL, NULL, 2, NULL, 0, 'Mix the marinade ingredients in a non-reactive bowl.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'969F34D024ABAD49B322FA4B94467374', X'7C01E94A2376FD4AA7C20E50BEA79363', X'7C01E94A2376FD4AA7C20E50BEA79363', 4, NULL, NULL, 2, NULL, 0, 'Place the slices of meat in the bowl. Mix well, cover with plastic wrap, and marinate the meat for 10 hours in the fridge. Toss the meat around once or twice during the process.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'E0D6F51CE49F6C43B704EA3A2C842EA7', X'7C01E94A2376FD4AA7C20E50BEA79363', X'7C01E94A2376FD4AA7C20E50BEA79363', 5, NULL, NULL, 2, NULL, 0, 'Once the marinating time is over, place the meat in a colander and drain off the liquid.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'B40E484AA7A1AA4E8596A47C61A29531', X'7C01E94A2376FD4AA7C20E50BEA79363', X'7C01E94A2376FD4AA7C20E50BEA79363', 6, NULL, NULL, 2, NULL, 0, 'Mix all of the dry rub ingredients in a medium-sized bowl.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'66487F50F7443942AE37B8E70B496EB5', X'7C01E94A2376FD4AA7C20E50BEA79363', X'7C01E94A2376FD4AA7C20E50BEA79363', 7, NULL, NULL, 2, NULL, 0, 'Once the meat is drained, dip both sides of each slice of meat into the dry rub.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'BE6A26C0254A6A4B9A05412BC9AF4EB0', X'7C01E94A2376FD4AA7C20E50BEA79363', X'7C01E94A2376FD4AA7C20E50BEA79363', 8, NULL, NULL, 2, NULL, 0, 'Follow the instructions for oven or dehydrator method, depending on which appliance you will be using.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'E491A0338E72D04DB1E8AA1E86A8F66A', X'4AA00975D3BE934EB91BD215EDDE7871', X'4AA00975D3BE934EB91BD215EDDE7871', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'747C57DA6F0FAC458EEF0F79CE6DB0E5', X'4AA00975D3BE934EB91BD215EDDE7871', X'4AA00975D3BE934EB91BD215EDDE7871', 1, NULL, NULL, 2, NULL, 0, 'Set a large skillet over medium-high heat. Add the oil or butter. Once hot, add the riced cauliflower. Cook, stirring frequently, until the cauliflower is tender, but still has a little bite, about 5 to 7 minutes. Season with salt and pepper to taste.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'707F580C1055B64A83C196F9F4AF9354', X'4AA00975D3BE934EB91BD215EDDE7871', X'4AA00975D3BE934EB91BD215EDDE7871', 2, NULL, NULL, 2, NULL, 0, 'Remove from heat, add the lime juice and chopped cilantro, and toss to combine. Serve immediately.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'9DAE9B438F2F33429BCD8A364A8E250E', X'B29579494A6E4E409223D683C37AE87D', X'B29579494A6E4E409223D683C37AE87D', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Before you start, chill your stand mixer bowl in the freezer for 15 minutes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'B9548B5FCF451A4D8B3BEA49905D50FE', X'B29579494A6E4E409223D683C37AE87D', X'B29579494A6E4E409223D683C37AE87D', 1, NULL, NULL, 2, NULL, 0, 'Carefully open the can by a few inches and slowly drain any liquid into a bowl. Do not shake or force the liquid out, let gravity do its work. Keep the liquid for soups, curries, or add to your morning smoothie.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'7508F9E2F068144BA11966F47BDA2BA7', X'B29579494A6E4E409223D683C37AE87D', X'B29579494A6E4E409223D683C37AE87D', 2, NULL, NULL, 2, NULL, 0, 'Fully open the can. Use a spoon to scoop out the thick cream into the chilled bowl of a stand mixer, avoiding adding any of the remaining liquid. Add agave and vanilla extract if using. Place the bowl on your mixer.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'69AD58C4A3F5CF45A9261B0E6B52E495', X'B29579494A6E4E409223D683C37AE87D', X'B29579494A6E4E409223D683C37AE87D', 3, NULL, NULL, 2, NULL, 0, 'Using the whisk attachment, start to whisk the coconut milk on a low speed, gradually increasing the speed to high. Let the mixer run for between 8 to 10 minutes. Once it is thickened and light and airy, stop the mixer. Unlike dairy cream, coconut whipped cream will not curdle, but over-whipping will flatten the cream.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'BCAFA132DB611C49AA36BAE74943A57B', X'B29579494A6E4E409223D683C37AE87D', X'B29579494A6E4E409223D683C37AE87D', 4, NULL, NULL, 2, NULL, 0, 'Serve the coconut cream immediately on your favorite desserts, cakes, or sundaes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'8139F5656FC8B6438612BC4AEA2A1D16', X'59EE711F205A744E8D0A32C26A4871FA', X'59EE711F205A744E8D0A32C26A4871FA', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Heat the oven to 350 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'1DBE42C92145024A8A878133B1FAFFEE', X'59EE711F205A744E8D0A32C26A4871FA', X'59EE711F205A744E8D0A32C26A4871FA', 1, NULL, NULL, 2, NULL, 0, 'Put the thawed riced cauliflower on a few doubled sheets of paper towel or a kitchen towel and squeeze out any excess moisture. Set aside.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'4391303A745D33429F8937133B8E8A3F', X'59EE711F205A744E8D0A32C26A4871FA', X'59EE711F205A744E8D0A32C26A4871FA', 2, NULL, NULL, 2, NULL, 0, 'Heat the oil in a large skillet over medium heat. Add the onion and garlic and cook, stirring, for 2 minutes. Add the ground beef and bell pepper and continue to cook until the meat is browned.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'75B3653CCB1A12478A4EE572A528CFF5', X'59EE711F205A744E8D0A32C26A4871FA', X'59EE711F205A744E8D0A32C26A4871FA', 3, NULL, NULL, 2, NULL, 0, 'Add the taco seasoning and stir until well blended.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'56F2FC431A0EDA468F6F77BEBFC58325', X'59EE711F205A744E8D0A32C26A4871FA', X'59EE711F205A744E8D0A32C26A4871FA', 4, NULL, NULL, 2, NULL, 0, 'Layer about half of the beef mixture in a 2-quart baking dish or casserole; top with about 1/2 cup of shredded cheese.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'42C48F83C3835140846639EEA85CA6F3', X'59EE711F205A744E8D0A32C26A4871FA', X'59EE711F205A744E8D0A32C26A4871FA', 5, NULL, NULL, 2, NULL, 0, 'Top the ground beef and cheese with the riced cauliflower and another 1/2 cup of shredded cheese.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'A7FD3A4288850A44A96828C57BB3ADBC', X'59EE711F205A744E8D0A32C26A4871FA', X'59EE711F205A744E8D0A32C26A4871FA', 6, NULL, NULL, 2, NULL, 0, 'Top with the remaining beef and another 1/2 cup of shredded cheese.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'4484D681759A7B4EB1A3461AE18BE9FA', X'59EE711F205A744E8D0A32C26A4871FA', X'59EE711F205A744E8D0A32C26A4871FA', 7, NULL, NULL, 2, NULL, 0, 'Spoon the salsa evenly over the second ground beef and cheese layers.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'DC79DB006F3B484C8D85C6DFB666E7B4', X'59EE711F205A744E8D0A32C26A4871FA', X'59EE711F205A744E8D0A32C26A4871FA', 8, NULL, NULL, 2, NULL, 0, 'Heat the cream in a saucepan over medium heat. Add 1 cup of shredded cheese and cook, stirring, until the cheese is melted, about two minutes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'28AA44189DD9C3409F220791248D10C0', X'59EE711F205A744E8D0A32C26A4871FA', X'59EE711F205A744E8D0A32C26A4871FA', 9, NULL, NULL, 2, NULL, 0, 'Pour the cream and cheese sauce mixture over the salsa layer. Top with the remaining 1/2 cup of shredded cheese.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'3FC2A8E072CC7A4A9023D734A3E33F5B', X'59EE711F205A744E8D0A32C26A4871FA', X'59EE711F205A744E8D0A32C26A4871FA', 10, NULL, NULL, 2, NULL, 0, 'Bake the casserole for 30 to 40 minutes, or until hot and bubbly. Garnish with chopped cilantro, if desired.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'0B094B2530EFB844B0A244D96F2B7F4E', X'59EE711F205A744E8D0A32C26A4871FA', X'59EE711F205A744E8D0A32C26A4871FA', 11, NULL, NULL, 2, NULL, 0, 'Serve the casserole with toppings, such as extra salsa, chopped green onions, avocado slices, guacamole, diced tomatoes, sliced olives, jalapeño pepper rings, or sour cream.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'F27C2596CB792440A753A847DFBE5A36', X'8B163BAE2BAA544485D5B4E81B57C438', X'8B163BAE2BAA544485D5B4E81B57C438', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat the oven to 350 F. Grease the doughnut pans and set aside.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'FFD3FAF3C985D044B41C0FBC83B7BB01', X'8B163BAE2BAA544485D5B4E81B57C438', X'8B163BAE2BAA544485D5B4E81B57C438', 1, NULL, NULL, 2, NULL, 0, 'In a large bowl, stir together the blanched almond flour, sugar substitute, baking powder, ground cinnamon, and salt.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'18C94E3D0CF6704488ECCE32D231512F', X'8B163BAE2BAA544485D5B4E81B57C438', X'8B163BAE2BAA544485D5B4E81B57C438', 2, NULL, NULL, 2, NULL, 0, 'In a small bowl, whisk together the melted butter, unsweetened almond milk, eggs, and vanilla extract.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'17A5874FC80E4E4391558BE1A5B8AB5C', X'8B163BAE2BAA544485D5B4E81B57C438', X'8B163BAE2BAA544485D5B4E81B57C438', 3, NULL, NULL, 2, NULL, 0, 'Add the egg mixture to the almond flour mixture and stir to combine.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'97879E0C0AEDD34DA2055B3D097D2628', X'8B163BAE2BAA544485D5B4E81B57C438', X'8B163BAE2BAA544485D5B4E81B57C438', 4, NULL, NULL, 2, NULL, 0, 'Spoon the batter into the prepared doughnut pans, filling them 3/4 of the way to the top. Bake for 25 to 28 minutes, or until a dark golden-brown color.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D5A0A3B2C6DEDB4693CF05B70ACCB643', X'8B163BAE2BAA544485D5B4E81B57C438', X'8B163BAE2BAA544485D5B4E81B57C438', 5, NULL, NULL, 2, NULL, 0, 'Remove the doughnuts from the pan and cool on a wire rack.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'25B8EF87A2B02A48A149508A476CFA32', X'8B163BAE2BAA544485D5B4E81B57C438', X'8B163BAE2BAA544485D5B4E81B57C438', 6, NULL, NULL, 2, NULL, 0, 'In a small bowl, combine the 1/2 cup of keto-friendly sugar substitute with the cinnamon. Working one at a time, brush both sides of the doughnut with the 3 tablespoons of melted butter, then press the doughnut in the sweetener and cinnamon mixture to coat. Repeat with the remaining doughnuts.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'F7AE14247EBE6442A19506A1784FD578', X'8B163BAE2BAA544485D5B4E81B57C438', X'8B163BAE2BAA544485D5B4E81B57C438', 7, NULL, NULL, 2, NULL, 0, 'Enjoy!');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'29A4C67015E0534B8D43829D58BCB5C1', X'6106909F81178B4CA968E16FAC6F3925', X'6106909F81178B4CA968E16FAC6F3925', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'27A8E15D85BF1F4A91B17F9A913229C5', X'6106909F81178B4CA968E16FAC6F3925', X'6106909F81178B4CA968E16FAC6F3925', 1, NULL, NULL, 2, NULL, 0, 'Whisk the egg until it is completely blended. Whisk in 1/2 cup of the cheese.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D6B5E7CB115C4843976F14CF74A1EB18', X'6106909F81178B4CA968E16FAC6F3925', X'6106909F81178B4CA968E16FAC6F3925', 2, NULL, NULL, 2, NULL, 0, 'Heat a mini waffle iron on high heat. Sprinkle some of the leftover cheese on the bottom of the iron.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D0D58D817185C34F933FA617A89B0B15', X'6106909F81178B4CA968E16FAC6F3925', X'6106909F81178B4CA968E16FAC6F3925', 3, NULL, NULL, 2, NULL, 0, 'Pour half of the batter into the waffle iron and then top with another sprinkle of cheese if you wish.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'776ACE9BCFFD66498A1A1CE4AD6CF4BA', X'6106909F81178B4CA968E16FAC6F3925', X'6106909F81178B4CA968E16FAC6F3925', 4, NULL, NULL, 2, NULL, 0, 'Cook for 2 to 3 minutes or until golden brown.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6D6DA3EFF07D2F41AA1A70F534A958E2', X'6106909F81178B4CA968E16FAC6F3925', X'6106909F81178B4CA968E16FAC6F3925', 5, NULL, NULL, 2, NULL, 0, 'Remove and place on a plate or cooling rack to cool while you prepare the second half of the batter. The waffle will continue to crisp as it cools.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'5E38E5A998995B43A60C283810FDD488', X'6106909F81178B4CA968E16FAC6F3925', X'6106909F81178B4CA968E16FAC6F3925', 6, NULL, NULL, 2, NULL, 0, 'Serve with butter and keto-friendly syrup for a sweet breakfast. Or use it as bread on your favorite sandwich.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'0DE7661230FE4347A27109715A46CC59', X'FA975F6C301BD24BB7FDA475308BCE56', X'FA975F6C301BD24BB7FDA475308BCE56', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Heat the oven to 250 F and remove the pork chops from the refrigerator.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'94D2193D53BEC34997CDA6A8D77E15D5', X'FA975F6C301BD24BB7FDA475308BCE56', X'FA975F6C301BD24BB7FDA475308BCE56', 1, NULL, NULL, 2, NULL, 0, 'Sprinkle salt and pepper evenly onto a chopping board. Press each pork chop into the seasoning, flip them over, and press again. Add a little more salt and pepper if more is needed on the other side.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'EF6130EDC2A5C74D94AE1FDE19333B13', X'FA975F6C301BD24BB7FDA475308BCE56', X'FA975F6C301BD24BB7FDA475308BCE56', 2, NULL, NULL, 2, NULL, 0, 'Heat a ridged grill pan over medium heat and add the olive oil and the butter. Once the butter is foaming, add the two pork chops and cook on one side for 7 minutes. Flip the chops over and cook a further 7 minutes. The fat on the chops should be nicely browned with good grill marks on the meat. When pressed in the center with a finger, the chops should be firm but not hard.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'071DE9FBEAD0E74EB8D3FCCC29348BB3', X'FA975F6C301BD24BB7FDA475308BCE56', X'FA975F6C301BD24BB7FDA475308BCE56', 3, NULL, NULL, 2, NULL, 0, 'Remove the chops from the pan and keep the pan to one side, unwashed. Place the chops into an ovenproof dish, cover with foil, and put into the warm oven to rest.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'13C2B28EABCE794C805161CB15A76A18', X'FA975F6C301BD24BB7FDA475308BCE56', X'FA975F6C301BD24BB7FDA475308BCE56', 4, NULL, NULL, 2, NULL, 0, 'Break the broccoli florets and break into small pieces. Put the pan back over medium heat, add the florets, and cook them for 3 minutes, shaking the pan from time to time. The florets should start to color. Remove from the pan and keep to one side.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'F4FF3808E77B5E4AB2E6DFE1D1820C80', X'FA975F6C301BD24BB7FDA475308BCE56', X'FA975F6C301BD24BB7FDA475308BCE56', 5, NULL, NULL, 2, NULL, 0, 'Raise the heat under the pan slightly. Once hot, add the white wine to deglaze the pan and stir to scrape up any bits from cooking. Let the wine bubble to reduce to approximately one tablespoon.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'5F20D124EA4EFD4BAF0DFDEE171E4D0B', X'FA975F6C301BD24BB7FDA475308BCE56', X'FA975F6C301BD24BB7FDA475308BCE56', 6, NULL, NULL, 2, NULL, 0, 'Lower the heat back to medium and add the chicken stock. Let it simmer until reduced by half. Stir the cream into the sauce and add the fennel fronds. Cook for a few minutes more. Add the broccoli to the sauce and stir in the Parmesan cheese.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'00E1D48156F8984A848C33808F1492A9', X'FA975F6C301BD24BB7FDA475308BCE56', X'FA975F6C301BD24BB7FDA475308BCE56', 7, NULL, NULL, 2, NULL, 0, 'Remove the foil from the pork chops, pour the sauce and veggies over, and serve.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'80D31FDE6D29E74EAAD6EFBBE836A097', X'2E39D14B2D76DB4E9B74504AA501A708', X'2E39D14B2D76DB4E9B74504AA501A708', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat oven to 350 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'1BCAAFBD3FBA8845AAD5E09D8EE2F71C', X'2E39D14B2D76DB4E9B74504AA501A708', X'2E39D14B2D76DB4E9B74504AA501A708', 1, NULL, NULL, 2, NULL, 0, 'In a large bowl, combine the almond flour with the salt.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'42D397E556B09C458BF76B14ABCE2966', X'2E39D14B2D76DB4E9B74504AA501A708', X'2E39D14B2D76DB4E9B74504AA501A708', 2, NULL, NULL, 2, NULL, 0, 'Add the melted coconut oil and egg. Stir to combine.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'05143BC6C7590A43A07B2340B2D0284E', X'2E39D14B2D76DB4E9B74504AA501A708', X'2E39D14B2D76DB4E9B74504AA501A708', 3, NULL, NULL, 2, NULL, 0, 'Spoon the pie crust dough into a 9-inch pie pan.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'608BF8D1195A474F871D6F8DCBC0BA6A', X'2E39D14B2D76DB4E9B74504AA501A708', X'2E39D14B2D76DB4E9B74504AA501A708', 4, NULL, NULL, 2, NULL, 0, 'Evenly press the pie crust into the bottom and up the sides of the pan.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'B56C767530F612449D0B634FD22FD430', X'2E39D14B2D76DB4E9B74504AA501A708', X'2E39D14B2D76DB4E9B74504AA501A708', 5, NULL, NULL, 2, NULL, 0, 'Using a fork, press indentations into the top edge of the pie crust for decoration.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'52DAD6773E37B24E85826BADC5C90F3A', X'2E39D14B2D76DB4E9B74504AA501A708', X'2E39D14B2D76DB4E9B74504AA501A708', 6, NULL, NULL, 2, NULL, 0, 'Bake in the preheated oven for 8 to 12 minutes, or until lightly golden brown.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'2C88A486E427904FB588EAC33AD5DA7C', X'2E39D14B2D76DB4E9B74504AA501A708', X'2E39D14B2D76DB4E9B74504AA501A708', 7, NULL, NULL, 2, NULL, 0, 'Cool completely before filling with any pie filling of your choice or as a replacement gluten-free crust in any no-bake pie recipe.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'999213987FFCC3408F9AE910504229CE', X'5AEE57FAF0340D458355E0B4D13EEC8A', X'5AEE57FAF0340D458355E0B4D13EEC8A', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat the oven to 425 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'05FDB5540894264698BEA1E6C44E2A18', X'5AEE57FAF0340D458355E0B4D13EEC8A', X'5AEE57FAF0340D458355E0B4D13EEC8A', 1, NULL, NULL, 2, NULL, 0, 'Coat a half sheet pan with the olive oil. Place it in the preheated oven for 10 minutes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'85B144941E42214DBF60B862D4142BB4', X'5AEE57FAF0340D458355E0B4D13EEC8A', X'5AEE57FAF0340D458355E0B4D13EEC8A', 2, NULL, NULL, 2, NULL, 0, 'Meanwhile, crack the eggs into a quart-sized pitcher, liquid measuring cup, or anything with a wide spout that can accommodate all the eggs.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'39EC1EA995F05C4C925887F677E96331', X'5AEE57FAF0340D458355E0B4D13EEC8A', X'5AEE57FAF0340D458355E0B4D13EEC8A', 3, NULL, NULL, 2, NULL, 0, 'Gently, yet expeditiously, pour the eggs onto the hot sheet pan, and return it to the oven. For sunnies, bake until the white is just set and the yolks are still liquid, about 5 minutes. Remove, season with salt and pepper, divide, and serve.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'CD6D9CB22C30214DAB57074F2799C6BD', X'ACC56BDDB8D8EC479E2416A61DDE25BA', X'ACC56BDDB8D8EC479E2416A61DDE25BA', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'58706C19BF00594D9DAFE73F3C8439C2', X'ACC56BDDB8D8EC479E2416A61DDE25BA', X'ACC56BDDB8D8EC479E2416A61DDE25BA', 1, NULL, NULL, 2, NULL, 0, 'Trim the cauliflower. Cut into florets and roughly chop the stem. Peel and large dice the onion and add both to the bowl of a food processor.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'0787D2B982610A428016B3BF17CCF957', X'ACC56BDDB8D8EC479E2416A61DDE25BA', X'ACC56BDDB8D8EC479E2416A61DDE25BA', 2, NULL, NULL, 2, NULL, 0, 'Pulse a few times until diced. Add salt and pulse a couple more times until minced. Let sit for 10 minutes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'E58C06D01A907D45AA0F8E50B65BD9D7', X'ACC56BDDB8D8EC479E2416A61DDE25BA', X'ACC56BDDB8D8EC479E2416A61DDE25BA', 3, NULL, NULL, 2, NULL, 0, 'Meanwhile, preheat the oven to 400 F. Line a baking sheet with parchment paper.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'1C593E4C8525194498FABBD1C1DD06E6', X'ACC56BDDB8D8EC479E2416A61DDE25BA', X'ACC56BDDB8D8EC479E2416A61DDE25BA', 4, NULL, NULL, 2, NULL, 0, 'Dump the cauliflower and onion onto a clean kitchen towel or a piece of cheesecloth. Fold up the towel around the mixture and squeeze out the excess moisture. Squeeze until liquid doesn''t freely drip from the towel when pressure is applied.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'CA84079F279BE641BBFA4B7378D1B296', X'ACC56BDDB8D8EC479E2416A61DDE25BA', X'ACC56BDDB8D8EC479E2416A61DDE25BA', 5, NULL, NULL, 2, NULL, 0, 'Add the drained cauliflower and onion to a large bowl. Add the cheese, egg, cornstarch, garlic powder, pepper, and 2 tablespoons of chives (if using). Mix well.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'A96D76A4144C154B8CC0E3A42A98D1FF', X'ACC56BDDB8D8EC479E2416A61DDE25BA', X'ACC56BDDB8D8EC479E2416A61DDE25BA', 6, NULL, NULL, 2, NULL, 0, 'Divide the mixture up into six equal piles evenly spaced on the prepared baking sheet. Press the mixture together and form into six patties 1/3 to 1/2-inch thick. Brush the tops gently with the oil and sprinkle with salt.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'07AAF7D1B2153849BF7E3DF968537449', X'ACC56BDDB8D8EC479E2416A61DDE25BA', X'ACC56BDDB8D8EC479E2416A61DDE25BA', 7, NULL, NULL, 2, NULL, 0, 'Bake for 30 to 40 minutes until browned on top. Let cool on the pan for 5 minutes before serving.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D7BC0F5EFFA50A45936688494DDDE120', X'D6E14F2ED2C1194189068A70668F294B', X'D6E14F2ED2C1194189068A70668F294B', 0, NULL, NULL, 2, NULL, 0, 'Gather ingredient, as well as two microwave safe plates and microwave safe paper towels.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'B3F6786014390243B564EF70DBF8A5D5', X'D6E14F2ED2C1194189068A70668F294B', X'D6E14F2ED2C1194189068A70668F294B', 1, NULL, NULL, 2, NULL, 0, 'Line a microwave-safe plate with microwave-safe paper towels.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'8F469E5EC0DAF4458F7A76B40EF9DE6B', X'D6E14F2ED2C1194189068A70668F294B', X'D6E14F2ED2C1194189068A70668F294B', 2, NULL, NULL, 2, NULL, 0, 'Arrange six bacon slices side-by-side on the towels. Make sure the bacon doesn''t overlap or the slices won''t cook evenly.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6508D9FBE52D834A81B54A13DE5692BF', X'D6E14F2ED2C1194189068A70668F294B', X'D6E14F2ED2C1194189068A70668F294B', 3, NULL, NULL, 2, NULL, 0, 'Cover the bacon with another microwave-safe paper towel to prevent splattering.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'9E69A0AFB380464EB99F9A64F33E3A0E', X'D6E14F2ED2C1194189068A70668F294B', X'D6E14F2ED2C1194189068A70668F294B', 4, NULL, NULL, 2, NULL, 0, 'Microwave the bacon for 3 minutes on high power and rotate the plate so the bacon cooks evenly. Cook for another minute.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'00B623A069724740B8909C7FFE2C2C92', X'D6E14F2ED2C1194189068A70668F294B', X'D6E14F2ED2C1194189068A70668F294B', 5, NULL, NULL, 2, NULL, 0, 'Remove the bacon from the plate and let it rest on a fresh paper towel for 2 to 3 minutes to drain off the excess fat.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'199FB4142CD0ED408439A5115995EECD', X'D6E14F2ED2C1194189068A70668F294B', X'D6E14F2ED2C1194189068A70668F294B', 6, NULL, NULL, 2, NULL, 0, 'Serve bacon immediately.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'27B32589A24962448683585613AD6A33', X'9BC1A050ECF5E34891EA9F537E415658', X'9BC1A050ECF5E34891EA9F537E415658', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'38C22EB7043C6A48BAB7CA2CEE7E24F9', X'9BC1A050ECF5E34891EA9F537E415658', X'9BC1A050ECF5E34891EA9F537E415658', 1, NULL, NULL, 2, NULL, 0, 'Add the olive oil to a small saucepan and heat on medium-high heat. Add the shallots and salt and saute until softened and translucent, about 4 minutes. Then add in the minced garlic and saute for 1 minute on medium-low heat.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'A566275480624B48801EFE41E3B6EE68', X'9BC1A050ECF5E34891EA9F537E415658', X'9BC1A050ECF5E34891EA9F537E415658', 2, NULL, NULL, 2, NULL, 0, 'Add the tomato paste, apple cider vinegar, erythritol, Worcestershire, liquid smoke, chili powder, smoked paprika, mustard, cumin, and water to the saucepan. Whisk and heat on medium-low heat until the ingredients have combined. Lower the heat to low and simmer for 20 minutes, stirring frequently until thickened and is slightly darker in color.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'C4EFB8C031EB9548A125743D2BE69B26', X'9BC1A050ECF5E34891EA9F537E415658', X'9BC1A050ECF5E34891EA9F537E415658', 3, NULL, NULL, 2, NULL, 0, 'Allow the sauce to cool slightly and then place it in a blender and blend until completely smooth. Taste and add more salt if needed.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'AA347214BE6C0C4B82612228F7D85DB2', X'9BC1A050ECF5E34891EA9F537E415658', X'9BC1A050ECF5E34891EA9F537E415658', 4, NULL, NULL, 2, NULL, 0, 'Store in an airtight container in the refrigerator for 1 week. Or can the sauce using safe canning techniques and store in the pantry for 6 months. Serve on top of your favorite grilled meats.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'2AE45604B7079940986BF175EA6EED74', X'984A83DF55AA664797AE8CB95DE2894C', X'984A83DF55AA664797AE8CB95DE2894C', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'322F236736E80A46A0B219747DAD3718', X'984A83DF55AA664797AE8CB95DE2894C', X'984A83DF55AA664797AE8CB95DE2894C', 1, NULL, NULL, 2, NULL, 0, 'Add the almonds to the bowl of a food processor. Pulse about 10 times, until some of the almonds are pulverized into powder and some are still chunky. Don''t process too much or you''ll make almond butter.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'E290F433C78D8B4C89C196490A852AFF', X'984A83DF55AA664797AE8CB95DE2894C', X'984A83DF55AA664797AE8CB95DE2894C', 2, NULL, NULL, 2, NULL, 0, 'Add the almond or nut butter, unsalted butter, confectioners'' erythritol, vanilla, and salt (if using). Process for one minute, stopping halfway through to scrape down the sides.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'1B14203AE6A57C49AEF39EB80C01AC94', X'984A83DF55AA664797AE8CB95DE2894C', X'984A83DF55AA664797AE8CB95DE2894C', 3, NULL, NULL, 2, NULL, 0, 'Chill the mixture in the refrigerator for 30 minutes. Use a cookie scoop to scoop the mixture into even portions and place on a parchment-lined baking sheet. If the mixture gets to warm, pop it back in the fridge for a few minutes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'7D6511FE0DA3064A99D955693B70DB63', X'984A83DF55AA664797AE8CB95DE2894C', X'984A83DF55AA664797AE8CB95DE2894C', 4, NULL, NULL, 2, NULL, 0, 'Melt the chocolate in the microwave, heating for 30-second intervals and stirring, or melt over a double boiler. Drizzle each of the balls with chocolate.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'98344071CF20C34B8F79B6C7C314DD89', X'984A83DF55AA664797AE8CB95DE2894C', X'984A83DF55AA664797AE8CB95DE2894C', 5, NULL, NULL, 2, NULL, 0, 'Place the baking sheet in the freezer for 15 minutes to firm up. Store the balls in an airtight container in the fridge for up to a week.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'DA0E03D58DB4414C891BD7FE1262451E', X'712730180CDE8B4798F28CDA743A8649', X'712730180CDE8B4798F28CDA743A8649', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'EC101E1B88E67C4C9493CA33B1C54C42', X'712730180CDE8B4798F28CDA743A8649', X'712730180CDE8B4798F28CDA743A8649', 1, NULL, NULL, 2, NULL, 0, 'Preheat oven to 450 F with racks in upper and lower thirds. Lightly grease a rimmed baking sheet or large oven-proof oval casserole. Leaving core and stem intact, cut the cauliflower crosswise (through the core) into 1-inch thick planks. Place in a single layer on the prepared baking sheet and season with salt and pepper. Roast on bottom rack until cauliflower is browned underneath and tender, 15 to 20 minutes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6F5C51627F5B254587B4DB974EE905FB', X'712730180CDE8B4798F28CDA743A8649', X'712730180CDE8B4798F28CDA743A8649', 2, NULL, NULL, 2, NULL, 0, 'Meanwhile, use kitchen scissors to finely chop tomatoes in the can. Heat 1 tablespoon olive oil in a small pot over medium-high. Add garlic and cook until lightly golden and fragrant, about 30 seconds. Add tomatoes and season to taste with salt and pepper. Bring to a boil, then reduce heat to medium-low and cook at a vigorous simmer until sauce is slightly reduced, 7 to 8 minutes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'C4CCE5251532034BAFE01B784DBF0839', X'712730180CDE8B4798F28CDA743A8649', X'712730180CDE8B4798F28CDA743A8649', 3, NULL, NULL, 2, NULL, 0, 'Stir in the basil. Remove from heat and set aside.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'B1668BA873B748448DE4EE79822223D4', X'712730180CDE8B4798F28CDA743A8649', X'712730180CDE8B4798F28CDA743A8649', 4, NULL, NULL, 2, NULL, 0, 'Switch oven to broil. Flip the cauliflower so the browned side is facing up. Spoon half of the sauce on top. Sprinkle mozzarella and half of the Parmesan cheese over. Broil on top rack until cheese is melted and browned in spots, 2 to 3 minutes (watch closely as broilers vary).');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'5B60E17EA74E384FAC5460BC617F87E5', X'712730180CDE8B4798F28CDA743A8649', X'712730180CDE8B4798F28CDA743A8649', 5, NULL, NULL, 2, NULL, 0, 'Serve cauliflower Parmesan immediately with remaining sauce and Parmesan cheese on the side.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'F92A31D4C99A85458F59362AA11AA49C', X'5BDDC36E88B56E46B7DC7B67BFE23783', X'5BDDC36E88B56E46B7DC7B67BFE23783', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'2111FB0318BE024F93FB4CD650CF89D7', X'5BDDC36E88B56E46B7DC7B67BFE23783', X'5BDDC36E88B56E46B7DC7B67BFE23783', 1, NULL, NULL, 2, NULL, 0, 'Add the prepared espresso to a small saucepan. The espresso can be prepared hours ahead of time or fresh. Whisk in the pumpkin puree, heavy cream, whole milk, pumpkin spice, and erythritol. Heat until steaming, then remove from the stove.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D46426B325D3F54B9592FD7367233990', X'5BDDC36E88B56E46B7DC7B67BFE23783', X'5BDDC36E88B56E46B7DC7B67BFE23783', 2, NULL, NULL, 2, NULL, 0, 'Froth the contents with a hand-held frother. You can also whisk vigorously. Just be careful not to splash yourself as you are stirring.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'F1D18CFB214C89469FDC8C95188C2B60', X'5BDDC36E88B56E46B7DC7B67BFE23783', X'5BDDC36E88B56E46B7DC7B67BFE23783', 3, NULL, NULL, 2, NULL, 0, 'Top with prepared whipped cream and a little cinnamon or pumpkin pie spice and serve immediately.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'393ADFA1A0A89748AE9B291A59477D32', X'8AF3FBFCC9D53545A81360A8294486E2', X'8AF3FBFCC9D53545A81360A8294486E2', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'2F9C379416ABF449AD865F7B6A986476', X'8AF3FBFCC9D53545A81360A8294486E2', X'8AF3FBFCC9D53545A81360A8294486E2', 1, NULL, NULL, 2, NULL, 0, 'Preheat the oven to 350 F. Combine the ground beef, sausage, and pork rinds in a large bowl. Mix until the ingredients are evenly distributed, but make sure not to over mix or else the meat will be tough.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'A044C56E79B38245835C31C2C353E8E6', X'8AF3FBFCC9D53545A81360A8294486E2', X'8AF3FBFCC9D53545A81360A8294486E2', 2, NULL, NULL, 2, NULL, 0, 'Whisk together the egg, milk, salt, pepper, parsley, Italian seasoning, and Parmesan cheese.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'081E08F7DA252D45A041B4AA27B12DA9', X'8AF3FBFCC9D53545A81360A8294486E2', X'8AF3FBFCC9D53545A81360A8294486E2', 3, NULL, NULL, 2, NULL, 0, 'Pour the egg mixture over the meat mixture. Add in the onion and garlic. Combine until all of the ingredients are evenly distributed.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'ED2B3BC5237FAF4ABB5151530A435D52', X'8AF3FBFCC9D53545A81360A8294486E2', X'8AF3FBFCC9D53545A81360A8294486E2', 4, NULL, NULL, 2, NULL, 0, 'Form the meat mixture into a loaf shape.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'43C50A01A615D94C9F0D97831832822C', X'8AF3FBFCC9D53545A81360A8294486E2', X'8AF3FBFCC9D53545A81360A8294486E2', 5, NULL, NULL, 2, NULL, 0, 'Wrap the meatloaf with the strips of bacon.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'4C43928AB58ED443B4CA840EBAB65485', X'8AF3FBFCC9D53545A81360A8294486E2', X'8AF3FBFCC9D53545A81360A8294486E2', 6, NULL, NULL, 2, NULL, 0, 'Carefully pick up the meatloaf and place it on a cooling rack over an aluminum foil-wrapped baking sheet. Pour the tomato sauce over the top of the meatloaf.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'70827D670A00414685E1BF800D48E433', X'8AF3FBFCC9D53545A81360A8294486E2', X'8AF3FBFCC9D53545A81360A8294486E2', 7, NULL, NULL, 2, NULL, 0, 'Bake in the preheated oven uncovered for one hour or until the top is caramelized and the internal temperature is 165 F. You can increase the temperature to 375 F for the last 5 minutes to further caramelize the top and crisp up the bacon.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'9051C8BF3269194AAB1871148DC1C265', X'8AF3FBFCC9D53545A81360A8294486E2', X'8AF3FBFCC9D53545A81360A8294486E2', 8, NULL, NULL, 2, NULL, 0, 'Remove from the oven and allow to cool slightly. Slice and serve immediately with your favorite keto sides, like mashed cauliflower and Brussels sprouts.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'96BC2F4E52B2E64FAC899FB1A9085287', X'788FD1431CD0B14DA7C798E737D4A434', X'788FD1431CD0B14DA7C798E737D4A434', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'897165478C77914C89F01FA813D1773F', X'788FD1431CD0B14DA7C798E737D4A434', X'788FD1431CD0B14DA7C798E737D4A434', 1, NULL, NULL, 2, NULL, 0, 'Preheat the oven to 400 F. Grease a 2-quart baking dish.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'8DBD27BAA873924095B6B893CB3BBC87', X'788FD1431CD0B14DA7C798E737D4A434', X'788FD1431CD0B14DA7C798E737D4A434', 2, NULL, NULL, 2, NULL, 0, 'Toss the cauliflower with the olive oil and season with salt and pepper. Spread out on a baking sheet and roast for about 10 minutes or until crisp-tender. Reduce the oven temperature to 375 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'C8A0000D23EE064A9DF83291FC5FD2DA', X'788FD1431CD0B14DA7C798E737D4A434', X'788FD1431CD0B14DA7C798E737D4A434', 3, NULL, NULL, 2, NULL, 0, 'Add the milk, cream cheese, mustard, turmeric, and garlic powder to a medium saucepan and heat over medium-low heat. Season with salt and pepper. Whisk until the cheese sauce is warmed through and creamy. Remove from the heat and stir in the cheddar cheese.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'4A4F55F9EAF6D540B70CC09D2EB30208', X'788FD1431CD0B14DA7C798E737D4A434', X'788FD1431CD0B14DA7C798E737D4A434', 4, NULL, NULL, 2, NULL, 0, 'In a large bowl, combine the cauliflower and cheese sauce and mix. Taste for seasoning. Pour into the prepared baking dish and top with Parmesan cheese.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'3261491E34167245AEB50CFAA9629CB5', X'788FD1431CD0B14DA7C798E737D4A434', X'788FD1431CD0B14DA7C798E737D4A434', 5, NULL, NULL, 2, NULL, 0, 'Bake for about 20 minutes or until bubbly, warmed all the way through and browning on top. If you''d like your mac and cheese browner on top, place under the broiler for 1 or 2 minutes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'2870EEBC074A2644A1210D36E99386DB', X'788FD1431CD0B14DA7C798E737D4A434', X'788FD1431CD0B14DA7C798E737D4A434', 6, NULL, NULL, 2, NULL, 0, 'Serve warm.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'90A6CE06B1BFC1439EF97C6FD918CA04', X'6E015F2F2D791D44AF9BC4DFBB641DE4', X'6E015F2F2D791D44AF9BC4DFBB641DE4', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat the oven to 400 F. Line a baking sheet with parchment paper.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'DA06E67C5A1F83439D36918A3FCAE6AA', X'6E015F2F2D791D44AF9BC4DFBB641DE4', X'6E015F2F2D791D44AF9BC4DFBB641DE4', 1, NULL, NULL, 2, NULL, 0, 'In a microwave-safe bowl, melt the mozzarella cheese and cream cheese in 30-second increments until completely melted.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'859A1E1985E671429A712D0C190290AA', X'6E015F2F2D791D44AF9BC4DFBB641DE4', X'6E015F2F2D791D44AF9BC4DFBB641DE4', 2, NULL, NULL, 2, NULL, 0, 'Whisk together 2 of the eggs, almond flour, baking powder, and salt.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'C9AD1A039C8CEC43A9D3BF3140E489E3', X'6E015F2F2D791D44AF9BC4DFBB641DE4', X'6E015F2F2D791D44AF9BC4DFBB641DE4', 3, NULL, NULL, 2, NULL, 0, 'Add the almond flour mixture to the melted cheese and mix until it forms a soft dough. Use a hand mixer to achieve the right consistency. The dough should feel soft and only slightly tacky.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D9DB5808037A7A42A4C46E9606529C0D', X'6E015F2F2D791D44AF9BC4DFBB641DE4', X'6E015F2F2D791D44AF9BC4DFBB641DE4', 4, NULL, NULL, 2, NULL, 0, 'Divide the dough into 30 small balls.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'0B3B3F0347EE6A4ABCAED2C332627F7E', X'6E015F2F2D791D44AF9BC4DFBB641DE4', X'6E015F2F2D791D44AF9BC4DFBB641DE4', 5, NULL, NULL, 2, NULL, 0, 'Shape each ball into a 3- to 4-inch rope.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'57306E3779C0EF4A8FDF89CAB7F9478E', X'6E015F2F2D791D44AF9BC4DFBB641DE4', X'6E015F2F2D791D44AF9BC4DFBB641DE4', 6, NULL, NULL, 2, NULL, 0, 'Wrap the rope around each hot dog 2 to 3 times. Place them on a parchment-lined baking sheet. Make sure they have a good amount of space between each of them. They will puff a bit when they cook.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'9F5FAB769DC6B64998CDFD6A563F51AC', X'6E015F2F2D791D44AF9BC4DFBB641DE4', X'6E015F2F2D791D44AF9BC4DFBB641DE4', 7, NULL, NULL, 2, NULL, 0, 'Add a teaspoon of water to the final egg and whisk until combined. Brush the egg mixture over the top of each hot dog.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'60F49BD096879D4EBA299D461A49D3A2', X'6E015F2F2D791D44AF9BC4DFBB641DE4', X'6E015F2F2D791D44AF9BC4DFBB641DE4', 8, NULL, NULL, 2, NULL, 0, 'Bake in the preheated oven for 8 to 10 minutes or until golden brown. The dough should also look firm to the touch.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'4781790B634EA747B396CF5029571D2D', X'6E015F2F2D791D44AF9BC4DFBB641DE4', X'6E015F2F2D791D44AF9BC4DFBB641DE4', 9, NULL, NULL, 2, NULL, 0, 'Whisk together the melted butter and garlic powder in a small bowl. Brush the top of each dog with the garlic butter. Sprinkle the top of each dog with the everything bagel seasoning.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D83914A30478154BBD1F1485047FFC13', X'6E015F2F2D791D44AF9BC4DFBB641DE4', X'6E015F2F2D791D44AF9BC4DFBB641DE4', 10, NULL, NULL, 2, NULL, 0, 'Serve immediately with your favorite dips.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'C9F835118AF2D3419749C7D9C9257AC1', X'D05236C768AF27469D8DE036C6D7E84C', X'D05236C768AF27469D8DE036C6D7E84C', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat oven to 350 F. Prepare a baking sheet by covering with parchment paper.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'53D2DF8D06CCA0499EAEDCD2ACF4E4A7', X'D05236C768AF27469D8DE036C6D7E84C', X'D05236C768AF27469D8DE036C6D7E84C', 1, NULL, NULL, 2, NULL, 0, 'In a large bowl, combine the natural peanut butter, unsweetened coconut, xylitol, eggs, vanilla extract, and sea salt.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'1776830C6B44E248B705C2AAEF0F868C', X'D05236C768AF27469D8DE036C6D7E84C', X'D05236C768AF27469D8DE036C6D7E84C', 2, NULL, NULL, 2, NULL, 0, 'Stir until completely smooth. Refrigerate at least 15 minutes to firm slightly.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'A55BA7D129779F4FA2D45EF34030F913', X'D05236C768AF27469D8DE036C6D7E84C', X'D05236C768AF27469D8DE036C6D7E84C', 3, NULL, NULL, 2, NULL, 0, 'When the dough is firm enough to handle, roll into 1-inch balls and place 1 inch apart on prepared baking sheets.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'34A9E344D65A624E86CA5444DF7B7C59', X'D05236C768AF27469D8DE036C6D7E84C', X'D05236C768AF27469D8DE036C6D7E84C', 4, NULL, NULL, 2, NULL, 0, 'Using a fork, press the top of each cookie in a crisscross pattern. If the fork sticks to the cookies when pressing, dip the fork in additional xylitol as necessary.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6018714C605A5D49A6D79CACE0EF5FB0', X'D05236C768AF27469D8DE036C6D7E84C', X'D05236C768AF27469D8DE036C6D7E84C', 5, NULL, NULL, 2, NULL, 0, 'Bake in the preheated oven for 8 to 10 minutes or until the cookies are set.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'1C886177164A9D49B1C23735122808A5', X'D05236C768AF27469D8DE036C6D7E84C', X'D05236C768AF27469D8DE036C6D7E84C', 6, NULL, NULL, 2, NULL, 0, 'Remove to a wire rack to cool completely.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D17934981FF4AB4A9F1EA81406F1771F', X'D05236C768AF27469D8DE036C6D7E84C', X'D05236C768AF27469D8DE036C6D7E84C', 7, NULL, NULL, 2, NULL, 0, 'Store in an airtight container.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'68703F39E68451409A4EF762845C15A6', X'D05236C768AF27469D8DE036C6D7E84C', X'D05236C768AF27469D8DE036C6D7E84C', 8, NULL, NULL, 2, NULL, 0, 'Enjoy!');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'51EB5401873E5549AC07E904D6E40EFA', X'03E85D221F450F4A841918878401820C', X'03E85D221F450F4A841918878401820C', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Line two large baking sheets with parchment paper and preheat the oven to 400 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D540643ED4B3BE4FBE84FF2BAA7E9F60', X'03E85D221F450F4A841918878401820C', X'03E85D221F450F4A841918878401820C', 1, NULL, NULL, 2, NULL, 0, 'Add the yeast, sugar, and warm water to a small bowl and mix. Set aside to let the yeast proof for about 5 minutes. Make sure you use warm water and not hot water to avoid killing the yeast.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'38647CEE9D20824BA2A7B49D1985C618', X'03E85D221F450F4A841918878401820C', X'03E85D221F450F4A841918878401820C', 2, NULL, NULL, 2, NULL, 0, 'Add the mozzarella and cream cheese to a microwave-safe bowl. Cook for 30-second intervals, stirring each time, until the cheeses are fully melted. Alternatively, place the cheeses in a heat-proof bowl and place over simmering water. Stir until the cheeses are melted.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'30E2BE699FB7614891B323FE2C465ED0', X'03E85D221F450F4A841918878401820C', X'03E85D221F450F4A841918878401820C', 3, NULL, NULL, 2, NULL, 0, 'Add the almond flour, baking powder, and xanthan gum to a food processor with a dough blade or a stand mixer with the dough attachment. Mix to combine. Add the eggs and 1 tablespoon of melted butter and pulse or mix until well combined.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'E1BEE1B2F2AE0D4595E0131521CB2876', X'03E85D221F450F4A841918878401820C', X'03E85D221F450F4A841918878401820C', 4, NULL, NULL, 2, NULL, 0, 'Add the yeast mixture and pulse or mix until combined. Add the cheese and process or mix until a cohesive dough forms, or about 5 minutes. Stop halfway through and scrape down the sides with a rubber spatula. Turn out of the bowl and form into a flat ball. Cut into 12 wedges.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'C9AAD3857600A6429572150B209D417E', X'03E85D221F450F4A841918878401820C', X'03E85D221F450F4A841918878401820C', 5, NULL, NULL, 2, NULL, 0, 'Roll each wedge, one at a time, into a rope about 16 inches long. Form into a pretzel shape and press lightly where the dough intersects. Move to the prepared cookie sheet. Repeat with the remaining dough, placing six pretzels on each pan. Brush with the remaining butter and sprinkle with salt.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'E6C6176DE116FB4A8F1F017816F272DD', X'03E85D221F450F4A841918878401820C', X'03E85D221F450F4A841918878401820C', 6, NULL, NULL, 2, NULL, 0, 'Bake for about 12 minutes, or until puffed, browned, and cooked through. Rotate the pans halfway through baking for the best results. Let cool for just a couple of minutes before serving warm.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'577F1C0F5DF7C744B55DAD3AB0E58E31', X'DA7FE848D0E50146B1BA4A85F300E232', X'DA7FE848D0E50146B1BA4A85F300E232', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'005DE9437FBB6C4084BFD5FAE8AD44D0', X'DA7FE848D0E50146B1BA4A85F300E232', X'DA7FE848D0E50146B1BA4A85F300E232', 1, NULL, NULL, 2, NULL, 0, 'Preheat oven broiler with an oven rack 6 inches from the heat source. Line a rimmed baking sheet with foil, then add tofu. Toss tofu with 1 tablespoon oil. Broil on top rack, flipping once, until golden and crisp, 8 to 10 minutes (watch carefully as broilers vary).');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'CC27B43E4CBE584CA4F80EA7E11184FE', X'DA7FE848D0E50146B1BA4A85F300E232', X'DA7FE848D0E50146B1BA4A85F300E232', 2, NULL, NULL, 2, NULL, 0, 'In a medium bowl, combine the fish sauce, tamarind, sugar, cilantro stems, and 2 tablespoons water; whisk to blend then set aside to let sugar and tamarind dissolve.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'BE1D9948CEC85041A1079C0DE78EB5C8', X'DA7FE848D0E50146B1BA4A85F300E232', X'DA7FE848D0E50146B1BA4A85F300E232', 3, NULL, NULL, 2, NULL, 0, 'In a small bowl, beat eggs. Heat 1 tablespoon in a medium skillet over medium-high. Add eggs, and cook, stirring, until cooked through, about 1 minute; transfer to a bowl. Rinse and dry skillet.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'365F44808C7A444BA74EDA786A6043E2', X'DA7FE848D0E50146B1BA4A85F300E232', X'DA7FE848D0E50146B1BA4A85F300E232', 4, NULL, NULL, 2, NULL, 0, 'Add 1 tablespoon of oil to the same skillet and heat over medium high. Add scallion whites and garlic; saute until fragrant, about 1 minute.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'3FAACF8A673AEE4A84D9755DCAD411DF', X'DA7FE848D0E50146B1BA4A85F300E232', X'DA7FE848D0E50146B1BA4A85F300E232', 5, NULL, NULL, 2, NULL, 0, 'Add the bean sprouts to the skillet. Cook until slightly tender but still crisp, about 1 minute. Stir sauce into pan, then remove from heat. Add tofu, spaghetti squash, and cilantro leaves to skillet, stirring to combine.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'7216D229DD4ECF4995A928B1C2F25645', X'DA7FE848D0E50146B1BA4A85F300E232', X'DA7FE848D0E50146B1BA4A85F300E232', 6, NULL, NULL, 2, NULL, 0, 'Stir egg back to skillet. Divide between plates. Garnish with peanuts and scallion greens. Serve with lime wedges to squeeze over before eating.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'201A2E8DB958344CBB5BCFD17FBB8E01', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat your waffle iron and lightly grease with butter, oil, or cooking spray. Preheat the oven to 250 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D594A0013B4A06448F59060A9F05A4A6', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', 1, NULL, NULL, 2, NULL, 0, 'In a small mixing bowl, combine the almond flour, baking powder, stevia, and salt. Whisk together until mixed. Set aside.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'2496759E0465B1449667814ACF3E4109', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', 2, NULL, NULL, 2, NULL, 0, 'Add the egg whites to a medium bowl and beat until doubled in volume and stiff peaks form. Set aside.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'FB961C598AEBA04F8E17C035CE58D497', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', 3, NULL, NULL, 2, NULL, 0, 'In a third large mixing bowl, combine the egg yolks, almond butter, melted butter, milk, and vanilla. Add the dry ingredients and mix until combined.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'97F20B1714E37347B81E9439A5C5A0FB', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', 4, NULL, NULL, 2, NULL, 0, 'Carefully fold in the egg whites, a large dollop at a time, until just combined. Be careful not to over-mix and knock all of the air out of the whipped egg whites.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'C9B42DAEEE032B489969FF6080203367', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', 5, NULL, NULL, 2, NULL, 0, 'Add 1/4 of the batter to your preheated, greased waffle iron and close the lid. Cook until the waffle is browned on both sides and cooked through. This will take just a few minutes or up to 10 minutes depending on your waffle iron.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'E0A1DA02D0CE294D92155DD38A709617', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', 6, NULL, NULL, 2, NULL, 0, 'Place the first waffle on a baking sheet and place in the preheated oven. Repeat with the remaining batter, storing the completed waffles in the oven to keep warm and crisp until all of the batter is used up.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'095C23B33E14C14C9FA2C87018755F1F', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', X'C3FF94AE1AB5DB4EB319C07D914CD5A8', 7, NULL, NULL, 2, NULL, 0, 'Serve warm with toppings of your choice.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D6E56117AFAB00489D38576C73B6BFE4', X'D269AFF001274C4EB3B96649C323FEB5', X'D269AFF001274C4EB3B96649C323FEB5', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'0F30286D1D03F6409B90E52B8EB8333C', X'D269AFF001274C4EB3B96649C323FEB5', X'D269AFF001274C4EB3B96649C323FEB5', 1, NULL, NULL, 2, NULL, 0, 'Heat 1 tablespoon of the oil in a medium skillet over medium-high. Add the cauliflower, garlic, and 1/4 cup water. Cover, reduce heat to medium, and cook until cauliflower is browned in spots and tender, 5 to 6 minutes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'A209718643BB99408CE19809944882E7', X'D269AFF001274C4EB3B96649C323FEB5', X'D269AFF001274C4EB3B96649C323FEB5', 2, NULL, NULL, 2, NULL, 0, 'Remove skillet from heat, and let the cauliflower cool, uncovered, for 10 minutes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'A4A1F7C3F379914AB8C6C9BEB81DF7DF', X'D269AFF001274C4EB3B96649C323FEB5', X'D269AFF001274C4EB3B96649C323FEB5', 3, NULL, NULL, 2, NULL, 0, 'Add the cooled cauliflower and garlic, remaining 2 tablespoons oil, tahini, lemon juice, paprika, and cumin to the bowl of a food processor. Process, drizzling in 1 tablespoon of water at a time (up to 4 tablespoons), until the hummus is smooth and reaches the desired consistency. Season to taste with salt and pepper.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'F738C206F178B642B48438DE48D8EBCD', X'D269AFF001274C4EB3B96649C323FEB5', X'D269AFF001274C4EB3B96649C323FEB5', 4, NULL, NULL, 2, NULL, 0, 'To serve, spread the hummus in a shallow bowl. Drizzle with olive oil and sprinkle with paprika. Serve with cut veggies for dipping.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'7BA13ACB7551D04DA509B2A9900E868E', X'E776C37F0A4924429471FACC67826C5D', X'E776C37F0A4924429471FACC67826C5D', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat the oven to 425 F. Line a baking sheet with parchment paper.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'A7F6409DE4FEEA4D83230CB4DA41FBB5', X'E776C37F0A4924429471FACC67826C5D', X'E776C37F0A4924429471FACC67826C5D', 1, NULL, NULL, 2, NULL, 0, 'Grate the cauliflower on a box grater or in a food processor. You may need to add the cauliflower to the food processor in batches.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'600F921810F4B64B8EF03BD3FC0DED6A', X'E776C37F0A4924429471FACC67826C5D', X'E776C37F0A4924429471FACC67826C5D', 2, NULL, NULL, 2, NULL, 0, 'Transfer the grated cauliflower to a large bowl. Add the eggs, 1 cup of the mozzarella cheese, Parmesan cheese, garlic powder, oregano, and salt and pepper. Stir the contents until they come together and form a loose dough.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'CE5E97F047F89C4687A9FB80BD5A1CB4', X'E776C37F0A4924429471FACC67826C5D', X'E776C37F0A4924429471FACC67826C5D', 3, NULL, NULL, 2, NULL, 0, 'Transfer the dough to the prepared baking sheet. Pat down with moistened hands to form a rectangular crust. It should be about 1/2 an inch thick.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'C97E47FCBB34F348B898A5E97B77B7F4', X'E776C37F0A4924429471FACC67826C5D', X'E776C37F0A4924429471FACC67826C5D', 4, NULL, NULL, 2, NULL, 0, 'Bake until golden brown and dry to the touch, about 25 minutes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'95C283EB9EE24645821E0BFDD9523F45', X'E776C37F0A4924429471FACC67826C5D', X'E776C37F0A4924429471FACC67826C5D', 5, NULL, NULL, 2, NULL, 0, 'Melt the butter in a small bowl. Add the minced garlic. Drizzle the garlic butter over the top of the cauliflower crust.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'46BB614E3BCE184DB5CDF98CF9A4C146', X'E776C37F0A4924429471FACC67826C5D', X'E776C37F0A4924429471FACC67826C5D', 6, NULL, NULL, 2, NULL, 0, 'Sprinkle the remaining mozzarella cheese over the top. If you are adding the crushed red pepper flakes, sprinkle the desired amount over the top as well. Bake again until the cheese has melted about 5 to 10 minutes.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'02FB485EE035CB45B06677940DE3E474', X'E776C37F0A4924429471FACC67826C5D', X'E776C37F0A4924429471FACC67826C5D', 7, NULL, NULL, 2, NULL, 0, 'Remove from the oven and top with chopped parsley if you wish.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D6A59A2DE7A13C4FA4E3F3E223C9DBA0', X'E776C37F0A4924429471FACC67826C5D', X'E776C37F0A4924429471FACC67826C5D', 8, NULL, NULL, 2, NULL, 0, 'Slice into sticks and serve immediately.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'B18EFC95A757A74A9C792117958AC34B', X'B02F2FADADEEE34EB925C5F0DB573568', X'B02F2FADADEEE34EB925C5F0DB573568', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'7EF121ED077D724E953383B790B2D22E', X'B02F2FADADEEE34EB925C5F0DB573568', X'B02F2FADADEEE34EB925C5F0DB573568', 1, NULL, NULL, 2, NULL, 0, 'Lay the tortilla chips into a pan or plate that is oven-proof and that you want to serve from. Use one larger pan or plate or two medium pans or plates for individual servings. Preheat the oven to 425 F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'FE87C6963C709547A725585B9E236CBC', X'B02F2FADADEEE34EB925C5F0DB573568', X'B02F2FADADEEE34EB925C5F0DB573568', 2, NULL, NULL, 2, NULL, 0, 'Add the shredded rotisserie chicken to a microwave-safe bowl. Stir the taco seasoning into the chicken and microwave for 2 minutes or until the chicken is heated through.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'8E74983D8840CD40BE4A95FA11292692', X'B02F2FADADEEE34EB925C5F0DB573568', X'B02F2FADADEEE34EB925C5F0DB573568', 3, NULL, NULL, 2, NULL, 0, 'Top the tortilla chips with the chicken mixture and then the cheddar cheese. Place into the preheated oven and bake for 5 to 7 minutes or until the cheese is melted and the edges of the chips are crisped.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'4B6BF95A18350B439ED2BD47C3FD961A', X'B02F2FADADEEE34EB925C5F0DB573568', X'B02F2FADADEEE34EB925C5F0DB573568', 4, NULL, NULL, 2, NULL, 0, 'While the chips are baking, prepare the queso. Add the diced tomatoes and green chiles and the Velveeta cheese to a medium-sized, microwave-safe bowl. Microwave for 2 to 3 minutes or until the mixture is totally melted. Stir to combine.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'1773FC7C1D29BD4B853739CDCC9F1829', X'B02F2FADADEEE34EB925C5F0DB573568', X'B02F2FADADEEE34EB925C5F0DB573568', 5, NULL, NULL, 2, NULL, 0, 'Drizzle the queso over the top of the baked chips and then top with guacamole, sour cream, salsa, and jalapeno.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'18D8F0642A5A3C49AC87C83FEA850616', X'8516D444EDBEA34D902104BAE28AD4C4', X'8516D444EDBEA34D902104BAE28AD4C4', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients and preheat the oven to 375F.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'7201B6A74BA25F48B50849CA4B1AD034', X'8516D444EDBEA34D902104BAE28AD4C4', X'8516D444EDBEA34D902104BAE28AD4C4', 1, NULL, NULL, 2, NULL, 0, 'Lay each skin down on a non-stick baking sheet, and spread them out so they take up as much space as possible without overlapping. Sprinkle with onion powder, then lay a sprig of fresh herbs (or an individual leaf of fresh sage) on top of each one, if using.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'BEE2A54CBBCD584C962F97224E930269', X'8516D444EDBEA34D902104BAE28AD4C4', X'8516D444EDBEA34D902104BAE28AD4C4', 2, NULL, NULL, 2, NULL, 0, 'Lay a second non-stick baking sheet on top of the first, tightly sandwiching the skins.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'749DB01FF27BCC4A8DF688F3F20769E4', X'8516D444EDBEA34D902104BAE28AD4C4', X'8516D444EDBEA34D902104BAE28AD4C4', 3, NULL, NULL, 2, NULL, 0, 'Bake for 20 minutes. You should be able to hear sizzling and popping as the skin renders.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'E10988C334BC3541AA7B780F887DD6BF', X'8516D444EDBEA34D902104BAE28AD4C4', X'8516D444EDBEA34D902104BAE28AD4C4', 4, NULL, NULL, 2, NULL, 0, 'Remove the pans and let skins cool for several minutes before lifting off the top pan. If you''re not using a non-stick pan, allow the skins to sit for 15 minutes after cooking. As they cool, they''ll release from the surface naturally (or with minimal help from a spatula).');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'1C16B1CBB075C34E862A131A671363D3', X'8516D444EDBEA34D902104BAE28AD4C4', X'8516D444EDBEA34D902104BAE28AD4C4', 5, NULL, NULL, 2, NULL, 0, 'Carefully remove the skins from the sheet  they''ll be fragile  transfer to a paper towel-lined plate, and season with Kosher salt and freshly ground black pepper.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'B0753966A0B86244A4A407C4B7C5F595', X'8516D444EDBEA34D902104BAE28AD4C4', X'8516D444EDBEA34D902104BAE28AD4C4', 6, NULL, NULL, 2, NULL, 0, 'Keep skins whole for use as chips, crackers, or sandwich filling, or crumble for use as a garnish. Keep any leftovers in a tightly sealed container in a cool, dry place for up to three days.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6F6E079C54598B43BF874305E9BE3FC7', X'5A9A46086C338E4599B7106F2D7E5B30', X'5A9A46086C338E4599B7106F2D7E5B30', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'34CAE1CA3182044CA7B1657BA3351112', X'5A9A46086C338E4599B7106F2D7E5B30', X'5A9A46086C338E4599B7106F2D7E5B30', 1, NULL, NULL, 2, NULL, 0, 'Preheat the oven to 350 F. Melt the mozzarella cheese in a microwave-safe bowl in thirty-second increments, stirring in between until completed melted.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'D346C4B42B0C1840B5F371BEF297889F', X'5A9A46086C338E4599B7106F2D7E5B30', X'5A9A46086C338E4599B7106F2D7E5B30', 2, NULL, NULL, 2, NULL, 0, 'With a whisk or fork, quickly mix the dry ingredients into the melted mozzarella. You can whisk together the dry ingredients before adding them to the cheese if you want to make sure they are completed blended. Knead the ingredients with your hands until it forms a soft dough.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'23C991A4A5CE7249B39F575AC9DF3A4A', X'5A9A46086C338E4599B7106F2D7E5B30', X'5A9A46086C338E4599B7106F2D7E5B30', 3, NULL, NULL, 2, NULL, 0, 'Since you cant use flour to dust the surface, roll out the dough in between two sheets of parchment paper to prevent sticking. Roll out the dough as thin as you can. The thinner the dough, the thinner the chip. The chips will puff when baked.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'9CC0DA162A539C4D8C0B7BF53FF8EFF7', X'5A9A46086C338E4599B7106F2D7E5B30', X'5A9A46086C338E4599B7106F2D7E5B30', 4, NULL, NULL, 2, NULL, 0, 'Cut the dough into triangles using a pizza cutter. You can make them whatever size you like.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6A809DA732D0F245B48370C8055AF51C', X'5A9A46086C338E4599B7106F2D7E5B30', X'5A9A46086C338E4599B7106F2D7E5B30', 5, NULL, NULL, 2, NULL, 0, 'Place the triangles onto a parchment-lined baking sheet. Make sure they are slightly apart from each other. All of the chips should fit on an average-size baking sheet. Bake for 15 minutes, flipping halfway through until golden brown and crisp on both sides.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'4691DB724D395444ADA2B5D690F71129', X'5A9A46086C338E4599B7106F2D7E5B30', X'5A9A46086C338E4599B7106F2D7E5B30', 6, NULL, NULL, 2, NULL, 0, 'Allow them to cool slightly and serve with your favorite dips like guacamole, salsa, or queso.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6261595EA4E29D40B9E14FB69FE9E935', X'A4A01037D56AF6449B357264C6EB3CA6', X'A4A01037D56AF6449B357264C6EB3CA6', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat the oven to 350 F and line 2 rimmed sheet pans with parchment paper.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'3FFB6F5DCFC3BD44BB14FB230DA0C761', X'A4A01037D56AF6449B357264C6EB3CA6', X'A4A01037D56AF6449B357264C6EB3CA6', 1, NULL, NULL, 2, NULL, 0, 'Add the almond flour, cocoa powder, salt, and baking soda to a bowl. Whisk until thoroughly combined and set aside.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'6256ADA4CBC41945BE7F3A7E62C8445B', X'A4A01037D56AF6449B357264C6EB3CA6', X'A4A01037D56AF6449B357264C6EB3CA6', 2, NULL, NULL, 2, NULL, 0, 'Cream the unsalted butter and sweetener using a hand mixer or stand mixer. Beat until lightened in color and fluffy.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'5FA1E88556953F44987090FC799BFE17', X'A4A01037D56AF6449B357264C6EB3CA6', X'A4A01037D56AF6449B357264C6EB3CA6', 3, NULL, NULL, 2, NULL, 0, 'Mix in the eggs and the vanilla extract.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'0DF542052B72CA42830CDCF0A3B62B94', X'A4A01037D56AF6449B357264C6EB3CA6', X'A4A01037D56AF6449B357264C6EB3CA6', 4, NULL, NULL, 2, NULL, 0, 'Stir in the flour mixture, just until incorporated, then fold in the chocolate chips.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'4CE7F450C685E746B8F2FC2320CE9BBB', X'A4A01037D56AF6449B357264C6EB3CA6', X'A4A01037D56AF6449B357264C6EB3CA6', 5, NULL, NULL, 2, NULL, 0, 'Scoop out approximately 1 1/2-ounce balls and place on 2 prepared sheet pans. Note that these cookies will spread a little, so keep them a couple of inches apart on the baking sheets.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'9452BC434A8C3847A9DAB16E1E55A678', X'A4A01037D56AF6449B357264C6EB3CA6', X'A4A01037D56AF6449B357264C6EB3CA6', 6, NULL, NULL, 2, NULL, 0, 'Flatten the top of each cookie very slightly and sprinkle with a bit of sea salt.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'E7EADA2BC6157547A4F26323964687EB', X'A4A01037D56AF6449B357264C6EB3CA6', X'A4A01037D56AF6449B357264C6EB3CA6', 7, NULL, NULL, 2, NULL, 0, 'Bake for 8 to 10 minutes until just set. The cookies will be very soft but will firm up slightly as they cool.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'955E558E5174B14AAC25DC5C4A30F234', X'044FDE97B23059499B809F75490FF49E', X'044FDE97B23059499B809F75490FF49E', 0, NULL, NULL, 2, NULL, 0, 'Gather the ingredients. Preheat the oven to 400 F and line a baking sheet with parchment paper.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'837D0293D669E145B9DDD93108CBC220', X'044FDE97B23059499B809F75490FF49E', X'044FDE97B23059499B809F75490FF49E', 1, NULL, NULL, 2, NULL, 0, 'Chop the bacon into a small dice. Add it to a sauté pan and cook on medium heat until they are almost crisp but still have a little fat and arent totally browned.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'36E3B9C3BC32B24EA8067A071256758E', X'044FDE97B23059499B809F75490FF49E', X'044FDE97B23059499B809F75490FF49E', 2, NULL, NULL, 2, NULL, 0, 'Drain the grease from the bacon on a paper towel-lined plate and set aside.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'2B5FEBB68DCF6B48B8C688184D2720D3', X'044FDE97B23059499B809F75490FF49E', X'044FDE97B23059499B809F75490FF49E', 3, NULL, NULL, 2, NULL, 0, 'Add the cream cheese, shredded cheddar, green onions, and garlic powder to a medium-sized bowl. Mash the ingredients together until they are combined and all of the ingredients are equally dispersed throughout the cream cheese.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'DF76BB7CFA9B6D49890F3E44E715D04C', X'044FDE97B23059499B809F75490FF49E', X'044FDE97B23059499B809F75490FF49E', 4, NULL, NULL, 2, NULL, 0, 'Cut each jalapeño in half lengthwise. Scoop out the seeds and ribs with a teaspoon. Make sure to wear plastic gloves when you do this step to avoid getting the peppers'' spicy oil on your hands.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'91AE357C94DFDA488F13A93BEEB4525B', X'044FDE97B23059499B809F75490FF49E', X'044FDE97B23059499B809F75490FF49E', 5, NULL, NULL, 2, NULL, 0, 'Stuff each jalapeño half with about a tablespoon of the cream cheese mixture. Do not overstuff as the filling will overflow as it bakes. Place them on the prepared baking sheet.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'C104A7A384620549A79C349D20B21446', X'044FDE97B23059499B809F75490FF49E', X'044FDE97B23059499B809F75490FF49E', 6, NULL, NULL, 2, NULL, 0, 'Sprinkle about a teaspoon of the bacon bits onto each popper. Press gently to make sure the bacon sticks and does not fall off.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'B59A74FB7CCCB4469F0259F523BE4D5B', X'044FDE97B23059499B809F75490FF49E', X'044FDE97B23059499B809F75490FF49E', 7, NULL, NULL, 2, NULL, 0, 'Bake for 10 to 15 minutes or until the peppers are softened and the bacon is browned and crisp.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipeInstructions` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment, step) VALUES (X'36C2916ECE4A9B49BF99B3E9D60A98C0', X'044FDE97B23059499B809F75490FF49E', X'044FDE97B23059499B809F75490FF49E', 8, NULL, NULL, 2, NULL, 0, 'Serve immediately.');
INSERT INTO `VWR INTERNAL RecipesbyDiet recipes` (row_id, parent_row_id, out_parent_row_id, source_index, template_url, template_content_value, status, status_message, segment) VALUES (X'E4A746C35EEFCB45842868BEA8982085', X'3759279129B9154E9B9E1EACDE5AB486', X'3759279129B9154E9B9E1EACDE5AB486', 0, NULL, NULL, 2, NULL, 0);
